import "../stylesheets/Filter.scss";

const Filters = (props) => {
  const handleChange = (ev) => {
    props.handleChange(ev.target.value);
  };

  const handleSubmit = (ev) => {
    ev.preventDefault();
  };
  return (
    <form onSubmit={handleSubmit}>
      <input type="text" onChange={handleChange}></input>
    </form>
  );
};
Filters.propTypes = {};
export default Filters;
